import React from 'react';

const renderData = (data) => {
    return(
        <>
        {data.map(d => (
            <div key={d.id} className='question-wrapper'>
                {d[0].text}
            </div>
        ))}
        </>
    )
}

const Question = (props) => {
    const data = props.response.data;
    return (
        <>
        {renderData(data)}
        </>
    )
}

export default Question;
